import StatusDot from  '../shared/StatusDot'
export default function Users({usersData}) {
    const users = usersData || [{
        first_name: 'First',
        last_name: 'Last',
        role: 'Project Lead',
        avatar: 'http://placekitten.com/200/300',
        city: 'New York'
    },
    {
        first_name: 'First',
        last_name: 'Last',
        role: 'Project Lead',
        avatar: 'http://placekitten.com/200/300',
        city: 'New York'
    },
    {
        first_name: 'First',
        last_name: 'Last',
        role: 'Project Lead',
        avatar: 'http://placekitten.com/200/300',
        city: 'New York'
    },
    {
        first_name: 'First',
        last_name: 'Last',
        role: 'Project Lead',
        avatar: 'http://placekitten.com/200/300',
        city: 'New York'
    },
    {
        first_name: 'First',
        last_name: 'Last',
        role: 'Project Lead',
        avatar: 'http://placekitten.com/200/300',
        city: 'New York'
    }
    ]
    const CardGenerator = () => {

        const Card = ({user, id}) => {
            return (
                <div className='overflow-x-hidden overflow-y-scroll w-48 whitespace-no-wrap flex flex-column flex-wrap justify-center pl-4 pt-4'>
                    <img src={users[id].avatar} className='w-32 h-32 inline-block rounded-full'/>
                    <div className="text-left w-24">
                        <h3 className="text-lg font-f1">{users[id].first_name+' '+users[id].last_name}</h3>
                        <p className='text-xs font-f1 font-thin'>{users[id].role}</p>
                        <p className='text-xs font-f1 font-thin'>{users[id].city}</p>
                        <div className='font-thin font-c1 flex items-center'>
                            <p>Online</p>
                            <StatusDot color='green-400'/>
                        </div>
                    </div>
                </div>
            )
        }
        const cards = users.map((user, i) => (<Card user={user} id={i} />))
        return cards

    }
    return(
        <div className="flex flex-no-wrap overflow-x-scroll">
            <CardGenerator />
        </div>
    )
}
